function fetchPokeList(...ids) {
    const select = document.getElementById("pokeList");
  
    ids.forEach((id) => {
      const option = document.createElement("option");
      option.value = id;
      option.textContent = `Pokemon ${id}`;
      select.appendChild(option);
    });
  }
  

function Fuse(){
    fetchPokeList(1,2,3,4);
    return(
        <div>
            <select id="pokeList">

            </select>
        </div>
    )
}

export default Fuse;
